import React from "react";
import { Typography, Card, CardContent, Grid } from "@material-ui/core";

export default function Acceuil() {
  return (
    <Grid container direction="row">
      <Grid xs={2} spacing={2}>
      <Card>
      </Card>
      </Grid>
      <Grid xs={2} spacing={3}>
      <Card>
      </Card>
      </Grid>
      <Grid xs={2} spacing={2}>
      <Card>
      </Card>
      </Grid>
    </Grid>
    
  );
}
